    hy: "Loading...",
    bg: "ВАШИЯТ Bada ТЕЛЕФОН. Имаме нужда от подробности, уточняващи неговия модел. Отидете в Настройки > Всичко за телефона (по-рано „Всичко за устройството“). Копирайте името и номера на модела в съответните полета по-долу.",
    "zh-CN":
      "您的 Bada 手机。我们需要您提供其型号的详细信息。前往“设置”>“关于手机”（原“关于设备”）。将“型号名称”和“型号编号”复制到下方相应的字段中。",
    "zh-TW": "Loading...",
    hr: "Loading...",
    cs: "VÁŠ TELEFON Bada. Potřebujeme podrobnosti specifikující jeho model. Přejděte do Nastavení > O telefonu (dříve „O zařízení“). Zkopírujte název modelu a číslo do příslušných polí níže.",
    da: "Loading...",
    nl: "UW Bada-TELEFOON. We hebben details nodig over het model. Ga naar Instellingen > Over de telefoon (voorheen 'Over het apparaat'). Kopieer de modelnaam en het nummer naar de overeenkomstige velden hieronder.",
    fi: "Loading...",
    fr: "VOTRE TÉLÉPHONE Bada. Nous avons besoin d'informations sur son modèle. Accédez à Paramètres > À propos du téléphone (anciennement « À propos de l'appareil »). Copiez le nom et le numéro du modèle dans les champs correspondants ci-dessous.",
    de: "Loading...",
    el: "Loading...",
