    hi: 'आपका बड़ा फ़ोन। हमें इसके मॉडल के बारे में जानकारी चाहिए। सेटिंग्स > फ़ोन के बारे में (जिसे पहले "डिवाइस के बारे में" कहा जाता था) पर जाएँ। मॉडल का नाम और नंबर नीचे दिए गए संबंधित फ़ील्ड में कॉपी करें।',
    hu: "Loading...",
    is: "Loading...",
    id: 'Ponsel Bada ANDA. Kami membutuhkan detail modelnya. Buka Pengaturan > Tentang ponsel (sebelumnya "Tentang perangkat"). Salin Nama dan Nomor Model ke kolom yang sesuai di bawah ini.',
    it: "Loading...",
    ja: "お使いのBadaスマートフォン。モデルを特定する詳細情報が必要です。「設定」>「端末情報」（旧「端末情報」）に移動してください。モデル名と番号を以下の該当する欄にコピーしてください。",
    kn: 'ನಿಮ್ಮ ಬ್ಯಾಡಾ ಫೋನ್. ಅದರ ಮಾದರಿಯನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸುವ ವಿವರಗಳು ನಮಗೆ ಅಗತ್ಯವಿದೆ. ಸೆಟ್ಟಿಂಗ್‌ಗಳು > ಫೋನ್ ಕುರಿತು (ಹಿಂದೆ "ಸಾಧನದ ಬಗ್ಗೆ") ಗೆ ಹೋಗಿ. ಕೆಳಗಿನ ಅನುಗುಣವಾದ ಕ್ಷೇತ್ರಗಳಿಗೆ ಮಾದರಿ ಹೆಸರು ಮತ್ತು ಸಂಖ್ಯೆಯನ್ನು ನಕಲಿಸಿ.',
    ko: '바다폰. 모델 정보를 입력해 주세요. 설정 > 휴대전화 정보(이전 명칭: "기기 정보")로 이동하세요. 모델명과 모델 번호를 아래 해당 필드에 복사하세요.',
    lt: "JŪSŲ Bada TELEFONAS. Mums reikia detalių, nurodančių jos modelį. Eikite į „Nustatymai“ > „Apie telefoną“ (anksčiau „Apie įrenginį“). Nukopijuokite modelio pavadinimą ir numerį į atitinkamus toliau pateiktus laukus.",
    ms: 'TELEFON Bada ANDA. Kami memerlukan butiran yang menyatakan modelnya. Pergi ke Tetapan > Perihal telefon (dahulunya "Perihal peranti"). Salin Nama Model dan Nombor ke medan yang sepadan di bawah.',
    ml: 'നിങ്ങളുടെ ബഡാ ഫോൺ. അതിൻ്റെ മാതൃക വ്യക്തമാക്കുന്ന വിശദാംശങ്ങൾ ഞങ്ങൾക്ക് ആവശ്യമാണ്. ക്രമീകരണങ്ങൾ > ഫോണിനെക്കുറിച്ച് (മുമ്പ് "ഉപകരണത്തെക്കുറിച്ച്") എന്നതിലേക്ക് പോകുക. ചുവടെയുള്ള അനുബന്ധ ഫീൽഡുകളിലേക്ക് മോഡലിൻ്റെ പേരും നമ്പറും പകർത്തുക.',
    no: "DIN Bada-TELEFON. Vi trenger detaljer som spesifiserer modellen. Gå til Innstillinger > Om telefonen (tidligere «Om enheten»). Kopier modellnavnet og -nummeret til de tilsvarende feltene nedenfor.",
    fa: "تلفن بادا شما. ما به جزئیاتی نیاز داریم که مدل آن را مشخص کند. به تنظیمات > درباره تلفن (قبلاً «درباره دستگاه») بروید. نام و شماره مدل را در فیلدهای مربوطه در زیر کپی کنید.",
    pl: "Loading...",
    pt: 'SEU TELEFONE Bada. Precisamos de detalhes especificando o modelo. Acesse Configurações > Sobre o telefone (anteriormente "Sobre o dispositivo"). Copie o Nome e o Número do Modelo nos campos correspondentes abaixo.',
    ro: "Loading...",
    ru: "ВАШ ТЕЛЕФОН Bada. Нам нужны данные о его модели. Перейдите в «Настройки» > «О телефоне» (ранее «Об устройстве»). Скопируйте название и номер модели в соответствующие поля ниже.",
    sr: "Loading...",
    es: 'TU TELÉFONO Bada. Necesitamos detalles que especifiquen el modelo. Ve a Ajustes > Acerca del teléfono (anteriormente "Acerca del dispositivo"). Copia el nombre y el número del modelo en los campos correspondientes a continuación.',
    sw: 'SIMU YAKO Bada. Tunahitaji maelezo kubainisha mfano wake. Nenda kwa Mipangilio > Kuhusu simu (zamani "Kuhusu kifaa"). Nakili Jina la Mfano na Nambari kwa sehemu zinazolingana hapa chini.',
    sv: 'DIN Bada TELEFON. Vi behöver detaljer som specificerar dess modell. Gå till Inställningar > Om telefonen (tidigare "Om enheten"). Kopiera modellnamn och nummer till motsvarande fält nedan.',
    tl: 'IYONG Bada PHONE. Kailangan namin ng mga detalye na tumutukoy sa modelo nito. Pumunta sa Mga Setting > Tungkol sa telepono (dating "Tungkol sa device"). Kopyahin ang Pangalan ng Modelo at Numero sa mga kaukulang field sa ibaba.',
    tr: "Loading...",
    ur: 'آپ کا بڑا فون۔ ہمیں اس کے ماڈل کی تفصیلات کی ضرورت ہے۔ ترتیبات > فون کے بارے میں (پہلے "آلہ کے بارے میں") پر جائیں۔ ماڈل کا نام اور نمبر نیچے دیے گئے متعلقہ فیلڈز میں کاپی کریں۔',
