    ur: "1. براہ کرم اس ونڈو کو کھینچ کر لائیں جس اسکرین کو آپ اس مطالعہ کے لیے استعمال کرنا چاہتے ہیں۔ \n2. اس اسکرین پر زیادہ تر ہونا کافی ہے۔\n2. پھر آگے بڑھیں پر کلک کریں یا واپسی دبائیں۔",
