    de: "Loading...",
    el: "1. Γείρετε την οθόνη σας για να κεντράρετε τα μάτια σας στην προεπισκόπηση βίντεο →\n2. Εάν η web κάμερα σας είναι κινητή, τοποθετήστε την στο επάνω κέντρο και κεντράρετε ξανά τα μάτια σας.\n3. Πατήστε RETURN ή κάντε κλικ στο PROCEED για να συνεχίσετε.",
    he: "1. הטה את המסך כדי למרכז את העיניים בתצוגה המקדימה של הסרטון ←\n2. אם מצלמת האינטרנט שלך ניתנת להזזה, הצב אותה במרכז העליון ומרכז מחדש את העיניים.\n3. לחץ על RETURN או לחץ על המשך כדי להמשיך.",
    hi: "1. वीडियो पूर्वावलोकन में अपनी आँखों को केंद्र में लाने के लिए अपनी स्क्रीन को झुकाएँ →\n2. यदि आपका वेब कैमरा चलने योग्य है, तो उसे ऊपरी केंद्र में रखें, और अपनी आँखों को पुनः केंद्र में लाएँ।\n3. जारी रखने के लिए RETURN दबाएँ या PROCEED पर क्लिक करें।",
    hu: "1. Döntse meg a képernyőt, hogy szeme középre kerüljön a videó előnézetében →\n2. Ha a webkamerája mozgatható, helyezze a tetejére középre, és állítsa újra a szemébe.\n3. Nyomja meg a RETURN gombot, vagy kattintson a PROCEED gombra a folytatáshoz.",
    is: "Loading...",
    id: "1. Miringkan layar Anda untuk memusatkan mata Anda di pratinjau video →\n2. Jika kamera web Anda dapat dipindahkan, letakkan di bagian tengah atas, dan pusatkan kembali mata Anda.\n3. Tekan RETURN atau klik PROCEED untuk melanjutkan.",
    it: "Loading...",
    ja: "1. 画面を傾けて、動画プレビューで目が中央に表示されるようにします →\n2. ウェブカメラが移動可能な場合は、上部中央に配置し、目が中央に表示されるようにします。\n3. 「Enter」キーを押すか、「続行」をクリックして続行します。",
    kn: "1. ವೀಡಿಯೊ ಪೂರ್ವವೀಕ್ಷಣೆಯಲ್ಲಿ ನಿಮ್ಮ ಕಣ್ಣುಗಳನ್ನು ಕೇಂದ್ರೀಕರಿಸಲು ನಿಮ್ಮ ಪರದೆಯನ್ನು ಓರೆಯಾಗಿಸಿ →\n2. ನಿಮ್ಮ ವೆಬ್ ಕ್ಯಾಮರಾ ಚಲಿಸಬಲ್ಲದಾಗಿದ್ದರೆ, ಅದನ್ನು ಮೇಲ್ಭಾಗದ ಮಧ್ಯದಲ್ಲಿ ಇರಿಸಿ ಮತ್ತು ನಿಮ್ಮ ಕಣ್ಣುಗಳನ್ನು ಮರು-ಮಧ್ಯದಲ್ಲಿ ಇರಿಸಿ.\n3. ರಿಟರ್ನ್ ಒತ್ತಿರಿ ಅಥವಾ ಮುಂದುವರಿಸಲು ಮುಂದುವರಿಸಿ ಕ್ಲಿಕ್ ಮಾಡಿ.",
    ko: "1. 화면을 기울여 눈이 비디오 미리보기 중앙에 오도록 하세요 →\n2. 웹캠이 이동식인 경우, 웹캠을 상단 중앙에 놓고 눈을 다시 중앙에 맞추세요.\n3. 계속하려면 'RETURN' 키를 누르거나 'PROCEED'를 클릭하세요.",
    lt: "1. Pakreipkite ekraną, kad vaizdo įrašo peržiūros centre akys būtų →\n2. Jei žiniatinklio kamera yra kilnojama, pastatykite ją viršuje centre ir vėl nukreipkite akis.\n3. Norėdami tęsti, paspauskite GRĮŽTI arba spustelėkite Tęsti.",
    ms: "1. Condongkan skrin anda untuk memusatkan mata anda dalam pratonton video →\n2. Jika kamera web anda boleh digerakkan, letakkannya di bahagian tengah atas, dan pusatkan semula mata anda.\n3. Tekan RETURN atau klik PROCEED untuk meneruskan.",
    ml: "1. വീഡിയോ പ്രിവ്യൂവിൽ നിങ്ങളുടെ കണ്ണുകളെ കേന്ദ്രീകരിക്കാൻ സ്‌ക്രീൻ ചരിക്കുക →\n2. നിങ്ങളുടെ വെബ് ക്യാമറ ചലിക്കാവുന്നതാണെങ്കിൽ, അത് മുകളിലെ മധ്യഭാഗത്ത് വയ്ക്കുക, നിങ്ങളുടെ കണ്ണുകൾ വീണ്ടും മധ്യത്തിലാക്കുക.\n3. തുടരുന്നതിന് റിട്ടേൺ അമർത്തുക അല്ലെങ്കിൽ തുടരുക ക്ലിക്കുചെയ്യുക.",
    no: "1. Vipp skjermen for å sentrere øynene i videoforhåndsvisningen →\n2. Hvis webkameraet ditt er bevegelig, plasser det øverst i midten og sentrer øynene på nytt.\n3. Trykk på RETURN eller klikk FORTSETT for å fortsette.",
    fa: "1. صفحه نمایش خود را کج کنید تا چشمان خود را در پیش نمایش ویدیو در مرکز قرار دهید →\n2. اگر دوربین وب شما متحرک است، آن را در مرکز بالا قرار دهید و دوباره چشمان خود را در مرکز قرار دهید.\n3. RETURN را فشار دهید یا برای ادامه روی PROCEED کلیک کنید.",
    pl: "1. Pochyl ekran, aby wyśrodkować wzrok w podglądzie wideo →\n2. Jeśli kamera internetowa jest ruchoma, umieść ją na środku górnej krawędzi ekranu i ponownie wyśrodkuj wzrok.\n3. Naciśnij przycisk RETURN lub kliknij przycisk KONTYNUUJ, aby kontynuować.",
