    sr: "Loading...",
    es: "1. Inclina la pantalla para centrar la vista en la vista previa del video →\n2. Si tu cámara web es móvil, colócala en la parte superior central y vuelve a centrar la vista.\n\n3. Presiona RETORNO o haz clic en CONTINUAR para continuar.",
    sw: "1. Inua skrini yako ili kuweka macho yako katikati katika onyesho la kukagua video →\n2. Ikiwa kamera yako ya wavuti inaweza kusogezwa, iweke sehemu ya juu katikati, na uweke tena macho yako katikati.\n3. Bonyeza RETURN au ubofye PROCEED ili kuendelea.",
