    cs: "1. Nakloňte obrazovku tak, aby se vaše oči v náhledu videa vystředily →\n2. Pokud je vaše webová kamera pohyblivá, umístěte ji do středu nahoře a znovu vycentrujte oči.\n3. Většina kamer má bílé nebo zelené světlo.\nJe váš fotoaparát nyní nahoře uprostřed?\nO Ano O Ne O Nevím (Všechny odpovědi jsou v pořádku – nebude to mít vliv na vaši účast.)",
