    ko: "1. 다시 한번 확인하세요. 뒤로 기대었다가 다시 앞으로 기대세요.\n2. 물체를 사용하여 거리를 다시 설정하세요.\n3. 움직이지 마세요. 물체를 치우고 스페이스바를 누르세요.",
    lt: "1. Dukart patikrinimas. Pasilenkite atgal, tada vėl pasilenkite į priekį.\n2. Norėdami dar kartą nustatyti atstumą, naudokite objektą.\n3. Likite ramiai – pašalinkite objektą ir bakstelėkite TARPAS.",
    ms: "1. Semakan dua kali. Condong ke belakang, kemudian condong ke hadapan semula.\n2. Gunakan objek untuk menetapkan jarak anda sekali lagi.\n3. Kekal diam—alih keluar objek dan ketik RUANG.",
    ml: "1. രണ്ടുതവണ പരിശോധിക്കൽ. പിന്നിലേക്ക് ചായുക, പിന്നെ വീണ്ടും മുന്നോട്ട് ചായുക.\n2. നിങ്ങളുടെ ദൂരം വീണ്ടും സജ്ജീകരിക്കാൻ ഒബ്‌ജക്റ്റ് ഉപയോഗിക്കുക.\n3. നിശ്ചലമായി നിൽക്കുക - ഒബ്‌ജക്‌റ്റ് നീക്കം ചെയ്‌ത് SPACE ടാപ്പുചെയ്യുക.",
    no: "1. Dobbeltsjekking. Len deg tilbake, så len deg fremover igjen.\n2. Bruk objektet til å stille inn avstanden din igjen.\n3. Hold deg stille – fjern objektet og trykk på MELLOMROM.",
    fa: "1. بررسی مجدد به عقب خم شوید، سپس دوباره به جلو خم شوید.\n2. از شی برای تنظیم مجدد فاصله خود استفاده کنید.\n3. ثابت بمانید - شی را بردارید و روی SPACE ضربه بزنید.",
    pl: "Loading...",
    pt: "1. Verifique novamente. Incline-se para trás e, em seguida, incline-se para a frente novamente.\n2. Use o objeto para definir a distância novamente.\n3. Permaneça parado — remova o objeto e toque em ESPAÇO.",
    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
    es: "1. Comprueba dos veces. Inclínate hacia atrás y luego hacia adelante.\n2. Usa el objeto para volver a ajustar la distancia.\n3. No te muevas, retira el objeto y pulsa la barra espaciadora.",
    sw: "Loading...",
    sv: "Loading...",
    tl: "1. Double-checking. Sumandal, pagkatapos ay sumandal muli.\n2. Gamitin ang bagay upang itakda muli ang iyong distansya.\n3. Manatiling tahimik—alisin ang bagay at tapikin ang SPACE.",
    tr: "1. Tekrar kontrol edin. Geriye yaslanın, sonra tekrar öne eğilin.\n2. Mesafenizi tekrar ayarlamak için nesneyi kullanın.\n3. Sabit kalın; nesneyi kaldırın ve BOŞLUK tuşuna dokunun.",
