    hi: "भाग लेने के लिए, अपने फोन के कैमरे को नीचे दिए गए क्यूआर कोड पर इंगित करें, और अपने फोन के डिस्प्ले पर दिखाई देने वाले लिंक पर टैप करें।",
    hu: "A RÉSZVÉTELHEZ irányítsa telefonja kameráját az alábbi QR-kódra, és koppintson a telefon kijelzőjén megjelenő hivatkozásra.",
