    fa: "برای شرکت، دوربین گوشی خود را به سمت کد QR زیر بگیرید و روی پیوندی که در صفحه نمایش تلفنتان ظاهر می‌شود ضربه بزنید.",
    pl: "ABY WZIĄĆ UDZIAŁ, skieruj kamerę swojego telefonu na poniższy kod QR i dotknij linku, który pojawi się na wyświetlaczu telefonu.",
    pt: "Loading...",
