    hy: "ՀԱԿԱՌԱԿԻՑ՝\n● Եթե ձեր տեսախցիկը չի ճանաչում QR կոդը, պարզապես պատճենեք\nxxx\nձեր հեռախոսի բրաուզերում և հպեք դիտարկիչի GO կոճակին: Այնուհետև այս էջը պետք է առաջ շարժվի:\n● Եթե ոչ, ապա LLL, և նորից փորձեք:\n● Եթե դա չհաջողվի, սեղմեք կոճակը, որը կոչվում է «❌ ԲՈԼՈՐ ՄԻԱՑՄԱՆ ՓՈՐՁԵՐԸ ՉԱՓԱԽՎԵՑԻՆ»:\n● Եթե ցանկանում եք մասնակցել առանց ձեր հեռախոսը միացնելու, սեղմեք ՆԱԽԸՆՏՐԵԼ ՉԻ կոճակը:\n● Վերջապես, եթե սմարթֆոն չկա, սեղմեք NO SMARTPHONE:",
