    hy: "ՏԵՂԱՑՐԵՔ տեսախցիկը QR LINK-ում: Ուղղեք ձեր հեռախոսի տեսախցիկը ստորև նշված QR կոդի վրա և հպեք ձեր հեռախոսի էկրանի հղմանը: Այնուհետև կարդացեք հրահանգները, որոնք հայտնվում են ձեր հեռախոսում:",
