    hi: "कैमरे को QR लिंक पर रखें। अपने फ़ोन के कैमरे को नीचे दिए गए QR कोड पर रखें और फ़ोन स्क्रीन पर दिए गए लिंक पर टैप करें। फिर फ़ोन पर आने वाले निर्देशों को पढ़ें।",
    hu: "Loading...",
    is: "Loading...",
    id: "ARAHKAN KAMERA KE TAUTAN QR. Arahkan kamera ponsel Anda ke kode QR di bawah ini, lalu ketuk tautan di layar ponsel Anda. Kemudian, baca petunjuk yang muncul di ponsel Anda.",
    it: "Loading...",
    ja: "QRリンクにカメラを向けてください。スマートフォンのカメラを下のQRコードに向け、スマートフォンの画面に表示されるリンクをタップしてください。その後、スマートフォンに表示される指示をお読みください。",
    kn: "QR ಲಿಂಕ್‌ನಲ್ಲಿ ಪಾಯಿಂಟ್ ಕ್ಯಾಮೆರಾ. ಕೆಳಗಿನ QR ಕೋಡ್‌ನಲ್ಲಿ ನಿಮ್ಮ ಫೋನ್‌ನ ಕ್ಯಾಮರಾವನ್ನು ಪಾಯಿಂಟ್ ಮಾಡಿ ಮತ್ತು ನಿಮ್ಮ ಫೋನ್‌ನ ಪರದೆಯಲ್ಲಿರುವ ಲಿಂಕ್ ಅನ್ನು ಟ್ಯಾಪ್ ಮಾಡಿ. ನಂತರ ನಿಮ್ಮ ಫೋನ್‌ನಲ್ಲಿ ಗೋಚರಿಸುವ ಸೂಚನೆಗಳನ್ನು ಓದಿ.",
    ko: "QR 코드에 카메라를 대세요. 휴대폰 카메라를 아래 QR 코드에 대고 휴대폰 화면의 링크를 탭하세요. 그런 다음 휴대폰에 표시되는 지침을 읽으세요.",
    lt: "TAŠKINĖ KAMEROS NUORODOS QR NUORODOS. Nukreipkite savo telefono kamerą į toliau pateiktą QR kodą ir telefono ekrane palieskite nuorodą. Tada perskaitykite instrukcijas, rodomas telefone.",
    ms: "POINT CAMERA DI PAUTAN QR. Halakan kamera telefon anda pada kod QR di bawah, dan ketik pautan dalam skrin telefon anda. Kemudian baca arahan yang dipaparkan pada telefon anda.",
    ml: "QR ലിങ്കിൽ പോയിൻ്റ് ക്യാമറ. ചുവടെയുള്ള QR കോഡിലേക്ക് നിങ്ങളുടെ ഫോണിൻ്റെ ക്യാമറ പോയിൻ്റ് ചെയ്‌ത് നിങ്ങളുടെ ഫോണിൻ്റെ സ്‌ക്രീനിലെ ലിങ്കിൽ ടാപ്പ് ചെയ്യുക. തുടർന്ന് നിങ്ങളുടെ ഫോണിൽ ദൃശ്യമാകുന്ന നിർദ്ദേശങ്ങൾ വായിക്കുക.",
    no: "PEK KAMERA PÅ QR-LINKEN. Pek telefonens kamera mot QR-koden nedenfor, og trykk på lenken på telefonens skjerm. Les deretter instruksjonene som vises på telefonen.",
    fa: "دوربین را در پیوند QR نشان دهید. دوربین تلفن خود را به سمت کد QR زیر بگیرید و روی پیوند موجود در صفحه گوشی خود ضربه بزنید. سپس دستورالعمل هایی را که روی گوشی شما ظاهر می شود را بخوانید.",
