    ro: "Loading...",
    ru: "НАВЕДИТЕ КАМЕРУ НА QR-ССЫЛКУ. Наведите камеру телефона на QR-код ниже и коснитесь ссылки на экране телефона. Затем прочтите инструкции на экране телефона.",
    sr: "Loading...",
    es: "APUNTA LA CÁMARA AL ENLACE QR. Apunta la cámara de tu teléfono al código QR que aparece a continuación y pulsa el enlace en la pantalla. Luego, lee las instrucciones que aparecen en tu teléfono.",
    sw: "Loading...",
    sv: "Loading...",
