    hy: "1. Փորձնական ձայները ձայնագրելուց առաջ պետք է չափել ֆոնային ձայնի մակարդակը։\n2. Խնդրում ենք ձայնագրության ընթացքում լռություն պահպանել:\n3. Երբ պատրաստ լինի, սեղմեք Record:",
    bg: "1. Преди да запишем експерименталните звуци, трябва да измерим нивото на фоновия звук.\n2. Моля, спазвайте тишина по време на записа.\n3. Когато сте готови, щракнете върху Запис.",
