    hi: "1. प्रायोगिक ध्वनियों को रिकॉर्ड करने से पहले, हमें पृष्ठभूमि ध्वनि स्तर को मापना होगा।\n2. कृपया रिकॉर्डिंग के दौरान मौन बनाए रखें।\n3. तैयार होने पर, रिकॉर्ड पर क्लिक करें।",
    hu: "Loading...",
