    it: "Loading...",
    ja: "1. 実験音を録音する前に、背景音のレベルを測定する必要があります。\n2. 録音中は静かにしてください。\n3. 準備ができたら、「録音」をクリックします。",
    kn: "1. ಪ್ರಾಯೋಗಿಕ ಶಬ್ದಗಳನ್ನು ರೆಕಾರ್ಡ್ ಮಾಡುವ ಮೊದಲು, ನಾವು ಹಿನ್ನೆಲೆ ಧ್ವನಿ ಮಟ್ಟವನ್ನು ಅಳೆಯಬೇಕು.\n2. ರೆಕಾರ್ಡಿಂಗ್ ಸಮಯದಲ್ಲಿ ದಯವಿಟ್ಟು ಮೌನವನ್ನು ಕಾಪಾಡಿಕೊಳ್ಳಿ.\n3. ಸಿದ್ಧವಾದಾಗ, ರೆಕಾರ್ಡ್ ಕ್ಲಿಕ್ ಮಾಡಿ.",
    ko: "1. 실험 소리를 녹음하기 전에 배경 소음 레벨을 측정해야 합니다.\n2. 녹음 중에는 무음을 유지하세요.\n3. 준비가 되면 '녹음'을 클릭하세요.",
    lt: "1. Prieš įrašydami eksperimentinius garsus, turime išmatuoti foninio garso lygį.\n2. Įrašymo metu tylėkite.\n3. Kai būsite pasiruošę, spustelėkite Įrašyti.",
