      "我们将测量您的两眼间距。使用视频图像观察您的双眼。将一支笔水平放置在您的眼前。将左右手拇指的指甲与左右瞳孔的中心对齐。然后将笔放在屏幕上的标尺上，测量拇指之间的距离。将左手拇指与零点对齐，并注意右手拇指的位置。放下笔，并在该点点击标尺。最后，点击“确定”继续。",
    "zh-TW":
      "我們將測量您的兩眼間距。使用視訊影像觀察您的雙眼。將一支筆水平放置在您的眼前。將左右手拇指的指甲與左右瞳孔的中心對齊。然後將筆放在螢幕上的標尺上，測量拇指之間的距離。將左手拇指與零點對齊，並注意右手拇指的位置。放下筆，並在該點點選標尺。最後，點選「確定」繼續。",
    hr: "Izmjerit ćemo udaljenost između vaših očiju. Koristite video sliku da promatrate svoje oči. Držite olovku vodoravno na licu ispred očiju. Poravnajte nokte desnog i lijevog palca sa središtima desne i lijeve zjenice. Zatim prinesite olovku ravnalu na zaslonu kako biste izmjerili razmak između svojih palaca. Poravnajte lijevi palac s nulom i primijetite gdje vam je desni palac. Spustite olovku i kliknite ravnalo na tom mjestu. Na kraju kliknite OK za nastavak.",
    cs: "Změříme vám vzdálenost mezi očima. Pomocí videoobrazu sledujte své oči. Držte pero vodorovně na obličeji před očima. Zarovnejte pravé a levé nehty se středy pravé a levé zornice. Poté přiložte pero k pravítku na obrazovce a změřte vzdálenost mezi vašimi palci. Srovnejte levý palec s nulou a všimněte si, kde máte pravý palec. Položte pero a v tomto bodě klepněte na pravítko. Nakonec pokračujte kliknutím na OK.",
    da: "Vi måler afstanden mellem dine øjne. Brug videobilledet til at se dine øjne. Hold en kuglepen vandret mod dit ansigt foran dine øjne. Juster dine højre og venstre tommelfingernegle med midten af dine højre og venstre pupiller. Tag derefter pennen hen til linealen på skærmen for at måle afstanden mellem dine tommelfingre. Ret din venstre tommelfinger mod nul, og læg mærke til, hvor din højre tommelfinger er. Læg pennen fra dig, og klik på linealen på det tidspunkt. Klik til sidst på OK for at fortsætte.",
    nl: "Loading...",
    fi: "Mittaamme silmiesi välisen etäisyyden. Käytä videokuvaa katsellaksesi silmiäsi. Pidä kynää vaakatasossa kasvojasi vasten silmiesi edessä. Kohdista oikean ja vasemman peukalon kynnesi oikean ja vasemman pupillisi keskikohtiin. Tuo sitten kynä näytön viivaimen luo mitataksesi peukalojesi välinen etäisyys. Kohdista vasen peukalosi nollaan ja huomaa, missä oikea peukalosi on. Aseta kynä alas ja napsauta viivainta siinä kohdassa. Jatka lopuksi napsauttamalla OK.",
    fr: "Loading...",
