    ar: "لنبدأ بقياس شاشتك.\n\n1. اختر عنصرًا من القائمة (مثل بطاقة ائتمان أو منفذ USB).\n\n2. ضعه على الشاشة واضبط شريط التمرير حتى يتطابق حجم الصورة مع حجمه.\n\n3. عند التطابق، اضغط على مفتاح المسافة للمتابعة.",
    hy: "Loading...",
    bg: "Loading...",
    "zh-CN":
      "让我们测量您的屏幕。\n1. 从菜单中选择一个对象（例如，信用卡或 USB 插头）。\n2. 将其放置在屏幕上，并调整滑块，直到图像与其尺寸匹配。\n3. 当它们匹配时，按空格键继续。",
    "zh-TW":
      "讓我們測量您的螢幕。\n1. 從選單中選擇一個物件（例如，信用卡或 USB 插頭）。\n2. 將其放置在螢幕上，並調整滑桿，直到影像與其尺寸相符。\n3. 當它們匹配時，按空白鍵繼續。",
