    cs: "Pojďme změřit vaši obrazovku.\n1. Vyberte objekt z nabídky (např. kreditní kartu nebo USB konektor).\n2. Umístěte jej na obrazovku a upravujte posuvník, dokud obrázek nebude odpovídat své velikosti.\n3. Když se shodují, pokračujte stisknutím mezerníku.",
    da: "Lad os måle din skærm.\n1. Vælg et objekt fra menuen (f.eks. kreditkort eller USB-stik).\n2. Placer det på skærmen, og juster skyderen, indtil billedet matcher dets størrelse.\n3. Når de matcher, skal du trykke på MELLEMRUM for at fortsætte.",
