    de: "Lassen Sie uns Ihren Bildschirm messen.\n1. Wählen Sie ein Objekt aus dem Menü (z. B. Kreditkarte oder USB-Stecker).\n2. Platzieren Sie es auf dem Bildschirm und passen Sie den Schieberegler an, bis das Bild die gewünschte Größe hat.\n3. Wenn die Größe übereinstimmt, drücken Sie die LEERTASTE, um fortzufahren.",
    el: "Loading...",
    he: "בוא נמדוד את המסך שלך.\n1. בחר אובייקט מהתפריט (למשל, כרטיס אשראי או תקע USB).\n2. הנח אותו על המסך והתאם את המחוון עד שהתמונה תתאים לגודלה.\n3. כשהם תואמים, הקש על מקש הרווח כדי להמשיך.",
    hi: "चलिए आपकी स्क्रीन का माप लेते हैं।\n1. मेनू से कोई वस्तु चुनें (जैसे, क्रेडिट कार्ड या USB प्लग)।\n2. इसे स्क्रीन पर रखें और स्लाइडर को तब तक एडजस्ट करें जब तक कि इमेज उसके आकार से मेल न खा जाए।\n3. जब वे मेल खा जाएँ, तो जारी रखने के लिए स्पेस बार दबाएँ।",
