    ar: "✅ ممتاز! تمت معايرة مكبرات الصوت، ويمكنك الآن وضع الميكروفون (أو الهاتف) جانبًا. لا تلمس مستوى الصوت حتى النهاية. يمكنك الآن معايرة الميكروفونات، واحدًا تلو الآخر.",
    hy: "✅ Գերազանց! Բարձրախոսներն այժմ չափորոշված են, և դուք կարող եք մի կողմ դնել խոսափողը (կամ հեռախոսը): ԾԱՎԱԼԻՆ ՄԻ ԿԱՊԵՔ մինչև վերջ։ Այժմ դուք կարող եք չափաբերել խոսափողները՝ մեկ առ մեկ:",
    bg: "✅ Отлично! Високоговорителите вече са калибрирани и можете да приберете микрофона (или телефона). НЕ ДОКОСВАЙТЕ ОБЕМА до самия край. Сега можете да калибрирате микрофоните един по един.",
