    de: "✅ Ausgezeichnet! Die Lautsprecher sind nun kalibriert, und Sie können das Mikrofon (oder Telefon) weglegen. Berühren Sie die Lautstärke erst ganz am Ende. Jetzt können Sie die Mikrofone einzeln kalibrieren.",
