    is: "✅ Frábært! Hátalararnir eru nú kvarðaðir og þú getur lagt frá þér hljóðnemann (eða símann). EKKI SNERTA RÁMIÐ fyrr en í lokin. Nú er hægt að kvarða hljóðnema, einn í einu.",
