    lt: "Dabar garsiakalbis sukalibruotas. NELIESKITE GARSUMO. Padėkite bet kokį mikrofoną, kurį naudojote. Dabar galite kalibruoti mikrofonus po vieną.",
    ms: "Pembesar suara kini ditentukur. JANGAN SENTUH VOLUME. Sila letakkan apa sahaja mikrofon yang anda gunakan. Kini anda boleh menentukur mikrofon, satu demi satu.",
