    no: "Høyttaleren er nå kalibrert. IKKE RØR VOLUMET. Vennligst legg vekk den mikrofonen du brukte. Nå kan du kalibrere mikrofoner, en om gangen.",
    fa: "اکنون بلندگو کالیبره شده است. به ولوم دست نزنید. لطفاً هر میکروفونی را که استفاده کردید کنار بگذارید. اکنون می‌توانید میکروفون‌ها را یکی یکی کالیبره کنید.",
    pl: "Loading...",
    pt: "O alto-falante agora está calibrado. NÃO MEXA NO VOLUME. Guarde o microfone que você usou. Agora você pode calibrar os microfones, um de cada vez.",
