    hy: "Շնորհակալություն։ Բարձրախոսն այժմ տրամաչափված է, և դուք կարող եք մի կողմ դնել սմարթֆոնը: ԿԱՐԵՎՈՐ. ՄԻ ԿԱՊԵՔ ԾԱՎԱԼԻ ՀՍԿԱՎՈՐՄԱՆԻՆ, քանի դեռ ուսումնասիրությունն ավարտված չէ: Ձայնի ձայնը փոխելը կփչացնի բարձրախոսի տրամաչափումը և կզրկվի բոլոր արդյունքներից: ",
