    hi: "Loading...",
    hu: "Köszönöm. A hangszóró kalibrálva van, és elteheti az okostelefont. FONTOS: NE ÉRINTSE MEG A HANGERŐSZABÁLYOZÓT, amíg a vizsgálat be nem fejeződik. A hangerő megváltoztatása tönkreteszi a hangszóró kalibrálását, és érvényteleníti az összes eredményt. ",
    is: "Takk. Hátalarinn er nú kvarðaður og þú getur lagt snjallsímann frá þér. MIKILVÆGT: EKKI SNERTA RÁÐSTJÓRNIN fyrr en rannsókninni er lokið. Að breyta hljóðstyrknum mun eyðileggja hátalarakvörðunina og ógilda allar niðurstöður. ",
    id: "Terima kasih. Speaker sekarang telah dikalibrasi, dan Anda dapat menyimpan ponsel pintar. PENTING: JANGAN SENTUH PENGATUR VOLUME hingga studi selesai. Mengubah volume akan merusak kalibrasi speaker dan membatalkan semua hasil.",
