    kn: "ಧನ್ಯವಾದಗಳು. ಧ್ವನಿವರ್ಧಕವನ್ನು ಈಗ ಮಾಪನಾಂಕ ಮಾಡಲಾಗಿದೆ ಮತ್ತು ನೀವು ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ಅನ್ನು ದೂರ ಇಡಬಹುದು. ಪ್ರಮುಖ: ಅಧ್ಯಯನ ಮುಗಿಯುವವರೆಗೆ ವಾಲ್ಯೂಮ್ ಕಂಟ್ರೋಲ್ ಅನ್ನು ಮುಟ್ಟಬೇಡಿ. ವಾಲ್ಯೂಮ್ ಅನ್ನು ಬದಲಾಯಿಸುವುದರಿಂದ ಧ್ವನಿವರ್ಧಕ ಮಾಪನಾಂಕ ನಿರ್ಣಯವನ್ನು ಹಾಳುಮಾಡುತ್ತದೆ ಮತ್ತು ಎಲ್ಲಾ ಫಲಿತಾಂಶಗಳನ್ನು ಅಮಾನ್ಯಗೊಳಿಸುತ್ತದೆ. ",
