    lt: "Loading...",
    ms: "Terima kasih. Pembesar suara kini ditentukur, dan anda boleh menyimpan telefon pintar itu. PENTING: JANGAN SENTUH KAWALAN VOLUME sehingga kajian selesai. Menukar kelantangan akan merosakkan penentukuran pembesar suara dan membatalkan semua keputusan. ",
