    no: "Takk. Høyttaleren er nå kalibrert, og du kan legge fra deg smarttelefonen. VIKTIG: IKKE RØR VOLUMKONTROLLEN før studien er ferdig. Endring av volumet vil ødelegge høyttalerkalibreringen og ugyldiggjøre alle resultater. ",
