    pt: "Obrigado. O alto-falante agora está calibrado e você pode guardar o smartphone. IMPORTANTE: NÃO TOQUE NO CONTROLE DE VOLUME até que o estudo seja concluído. Alterar o volume prejudicará a calibração do alto-falante e invalidará todos os resultados.",
    ro: "Mulţumesc. Difuzorul este acum calibrat și puteți pune deoparte smartphone-ul. IMPORTANT: NU ATINGEȚI CONTROLUL VOLUMULUI până la finalizarea studiului. Schimbarea volumului va distruge calibrarea difuzorului și va invalida toate rezultatele. ",
