    hr: "Zahvaljujemo na sudjelovanju u našoj anketi. Nemojte odustati. Pritisnite Nastavi kako bismo mogli spremiti rezultate i preusmjeriti vas natrag na Prolific s vašim kodom za dovršetak. Hvala.",
