    fr: "Merci d'avoir participé à notre enquête. N'abandonnez pas ! Cliquez sur « Continuer » pour que nous puissions enregistrer les résultats et vous rediriger vers Prolific avec votre code de participation. Merci.",
    de: "Vielen Dank für Ihre Teilnahme an unserer Umfrage. Beenden Sie die Umfrage nicht. Klicken Sie auf „Weiter“, damit wir die Ergebnisse speichern und Sie mit Ihrem Teilnahmecode zurück zu Prolific leiten können. Danke.",
