    hi: "हमारे सर्वेक्षण में भाग लेने के लिए धन्यवाद। रुकें नहीं। आगे बढ़ें पर क्लिक करें ताकि हम परिणाम सहेज सकें और आपको आपके पूर्ण कोड के साथ प्रोलिफिक पर वापस भेज सकें। धन्यवाद।",
    hu: "Köszönjük, hogy részt vett felmérésünkben. Ne hagyd abba. Nyomja meg a Folytatás gombot, hogy elmenthessük az eredményeket, és visszairányíthassuk a Prolific-hoz a kitöltési kóddal. Köszönöm.",
