    fa: "از اینکه در نظرسنجی ما شرکت کردید سپاسگزاریم. ترک نکن. ادامه را بزنید تا بتوانیم نتایج را ذخیره کنیم و با کد تکمیل شما به Prolific برگردید. با تشکر",
    pl: "Dziękujemy za udział w ankiecie. Nie rezygnuj. Kliknij „Kontynuuj”, abyśmy mogli zapisać wyniki i przekierować Cię z powrotem do Prolific z kodem ukończenia. Dziękujemy.",
    pt: 'Obrigado por participar da nossa pesquisa. Não desista. Clique em "Prosseguir" para que possamos salvar os resultados e redirecioná-lo de volta para a Prolific com o seu código de conclusão. Obrigado.',
    ro: "Vă mulțumim pentru participarea la sondajul nostru. Nu renunta. Apăsați Continuați, astfel încât să putem salva rezultatele și să vă redirecționăm înapoi la Prolific cu codul de completare. Mulţumesc.",
