    kn: "❌ ಕ್ಷಮಿಸಿ, ತೀರಾ ಇತ್ತೀಚಿನ ಎಡ ಮತ್ತು ಬಲ ಅಳತೆಗಳು ಅಸಮಂಜಸವಾಗಿವೆ. ದಯವಿಟ್ಟು ಮತ್ತೆ ಪ್ರಯತ್ನಿಸಿ. ಒಂದು ಕಣ್ಣು ಮುಚ್ಚಿ ಇರಿ. ಶಿಲುಬೆಯ ಮೇಲೆ ಕೇಂದ್ರೀಕರಿಸಿ ಮತ್ತು ನಿಮ್ಮ ಕಣ್ಣಿನ ಮೂಲೆಯಿಂದ ಮಿನುಗುವ ಬಿಂದುವನ್ನು ಮೇಲ್ವಿಚಾರಣೆ ಮಾಡಿ. ಡಾಟ್ ಅನ್ನು ಎಡಕ್ಕೆ ಮತ್ತು ಬಲಕ್ಕೆ ಸ್ಲೈಡ್ ಮಾಡಿ ಅದು ನಿಮ್ಮ ಬ್ಲೈಂಡ್‌ಸ್ಪಾಟ್‌ನಲ್ಲಿ ಕಣ್ಮರೆಯಾಗುವವರೆಗೆ, ತದನಂತರ SPACE ಬಾರ್ ಅನ್ನು ಒತ್ತಿರಿ. ನೀವು ಎರಡೂ ಕಣ್ಣುಗಳನ್ನು ಪರೀಕ್ಷಿಸುವಾಗ ನಿಮ್ಮ ವೀಕ್ಷಣಾ ಅಂತರವನ್ನು ಕಾಪಾಡಿಕೊಳ್ಳಿ.",
    ko: "❌ 죄송합니다. 최근 좌우 측정값이 일치하지 않았습니다. 다시 시도해 주세요. 한쪽 눈을 감으세요. 십자선에 초점을 맞추고 눈꼬리로 깜빡이는 점을 확인하세요. 점이 사각지대에 사라질 때까지 좌우로 밀고 스페이스 바를 누르세요. 양쪽 눈을 검사하는 동안 시야 거리를 유지하세요.",
    lt: "❌ Atsiprašome, paskutiniai kairės ir dešinės pusės matavimai buvo nenuoseklūs. Bandykite dar kartą. Laikykite vieną akį užmerktą. Sutelkite dėmesį į kryžių ir stebėkite mirksintį tašką akies kamputyje. Slinkite tašką kairėn ir dešinėn, kol jis išnyks jūsų aklojoje zonoje, tada paspauskite tarpo klavišą. Išlaikykite žiūrėjimo atstumą, kai tikrinate abi akis.",
    ms: "❌ Maaf, ukuran kiri dan kanan terkini tidak konsisten. Sila cuba lagi. Tutup sebelah mata. Fokus pada salib dan pantau titik berkelip di sudut mata anda. Luncurkan titik ke kiri dan kanan sehingga ia hilang ke titik buta anda, kemudian tekan bar SPACE. Kekalkan jarak tontonan anda semasa anda menguji kedua-dua mata.",
    ml: "❌ ക്ഷമിക്കണം, ഏറ്റവും പുതിയ ഇടത്, വലത് അളവുകൾ പൊരുത്തമില്ലാത്തതായിരുന്നു. ദയവായി വീണ്ടും ശ്രമിക്കുക. ഒരു കണ്ണ് അടയ്ക്കുക. കുരിശിൽ ഫോക്കസ് ചെയ്യുക, നിങ്ങളുടെ കണ്ണിൻ്റെ കോണിൽ നിന്ന് മിന്നുന്ന ഡോട്ട് നിരീക്ഷിക്കുക. നിങ്ങളുടെ ബ്ലൈൻഡ്‌സ്‌പോട്ടിലേക്ക് അത് അപ്രത്യക്ഷമാകുന്നതുവരെ ഡോട്ട് ഇടത്തോട്ടും വലത്തോട്ടും സ്ലൈഡുചെയ്യുക, തുടർന്ന് സ്‌പെയ്‌സ് ബാറിൽ അമർത്തുക. രണ്ട് കണ്ണുകളും പരിശോധിക്കുമ്പോൾ നിങ്ങളുടെ കാഴ്ച ദൂരം നിലനിർത്തുക.",
    no: "❌ Beklager, de siste målingene til venstre og høyre var inkonsekvente. Vennligst prøv igjen. Hold ett øye lukket. Fokuser på korset og overvåk den blinkende prikken ut av øyekroken. Skyv prikken til venstre og høyre til den forsvinner inn i blindsonen din, og trykk deretter på MELLOMROM. Hold visningsavstanden mens du tester begge øynene.",
    fa: "❌ متأسفیم، اندازه‌گیری‌های اخیر چپ و راست ناسازگار بودند. لطفا دوباره امتحان کنید. یک چشم خود را بسته نگه دارید. روی صلیب تمرکز کنید و نقطه چشمک زن را از گوشه چشم خود نظارت کنید. نقطه را به چپ و راست بلغزانید تا در نقطه کور ناپدید شود و سپس نوار SPACE را بزنید. هنگام تست هر دو چشم فاصله دید خود را حفظ کنید.",
    pl: "Loading...",
    pt: "❌ Desculpe, as medições mais recentes do lado esquerdo e direito estavam inconsistentes. Tente novamente. Mantenha um olho fechado. Concentre-se na cruz e observe o ponto piscante no canto do olho. Deslize o ponto para a esquerda e para a direita até que ele desapareça no seu ponto cego e, em seguida, pressione a barra de espaço. Mantenha a distância de visão enquanto testa os dois olhos.",
    ro: "Loading...",
    ru: "❌ Извините, последние результаты измерений слева и справа оказались несоответствующими. Попробуйте ещё раз. Закройте один глаз. Сфокусируйтесь на крестике и следите за мигающей точкой краем глаза. Двигайте точку влево и вправо, пока она не исчезнет в слепой зоне, а затем нажмите пробел. Сохраняйте дистанцию при проверке обоих глаз.",
    sr: "Loading...",
    es: "❌ Lo sentimos, las mediciones más recientes de los ojos izquierdo y derecho fueron inconsistentes. Inténtalo de nuevo. Mantén un ojo cerrado. Enfócate en la cruz y observa el punto parpadeante con el rabillo del ojo. Desliza el punto de izquierda a derecha hasta que desaparezca en tu punto ciego y luego pulsa la barra espaciadora. Mantén la distancia de visión mientras examinas ambos ojos.",
    sw: "❌ Samahani, vipimo vya hivi majuzi zaidi vya kushoto na kulia havikuwa sawa. Tafadhali jaribu tena. Weka jicho moja limefungwa. Zingatia msalaba na ufuatilie nukta inayong'aa kutoka kwenye kona ya jicho lako. Telezesha kitone kushoto na kulia hadi kipotee kwenye upofu wako, kisha ugonge upau wa SPACE. Dumisha umbali wako wa kutazama unapojaribu macho yote mawili.",
    sv: "❌ Tyvärr, de senaste vänster- och högermåtten var inkonsekventa. Försök igen. Håll ett öga stängt. Fokusera på korset och övervaka den blinkande punkten i ögonvrån. Skjut punkten åt vänster och höger tills den försvinner i din döda vinkel och tryck sedan på MELLANSLAG. Behåll ditt synavstånd när du testar båda ögonen.",
    tl: "❌ Paumanhin, hindi pare-pareho ang pinakahuling kaliwa at kanang mga sukat. Pakisubukang muli. Panatilihing nakapikit ang isang mata. Tumutok sa krus at subaybayan ang kumikislap na tuldok sa sulok ng iyong mata. I-slide ang tuldok pakaliwa at pakanan hanggang sa mawala ito sa iyong blindspot, at pagkatapos ay pindutin ang SPACE bar. Panatilihin ang iyong distansya sa pagtingin habang sinusuri mo ang parehong mga mata.",
    tr: "Loading...",
    ur: "❌ معذرت، حالیہ بائیں اور دائیں پیمائشیں متضاد تھیں۔ براہ کرم دوبارہ کوشش کریں۔ ایک آنکھ بند رکھیں۔ کراس پر توجہ مرکوز کریں اور اپنی آنکھ کے کونے سے چمکتے ہوئے نقطے کی نگرانی کریں۔ ڈاٹ کو بائیں اور دائیں سلائیڈ کریں جب تک کہ یہ آپ کے بلائنڈ سپاٹ میں غائب نہ ہو جائے، اور پھر SPACE بار کو ماریں۔ دونوں آنکھوں کی جانچ کرتے وقت اپنے دیکھنے کا فاصلہ برقرار رکھیں۔",
