    kn: "ತುಂಬಾ ಚಿಕ್ಕದು! ದಯವಿಟ್ಟು ಉದ್ದವಾದ ವಸ್ತುವನ್ನು ಆಯ್ಕೆಮಾಡಿ. ಸುರಕ್ಷಿತವಾಗಿರಲು, ಚೂಪಾದ ವಸ್ತುಗಳನ್ನು (ಪೆನ್ಸಿಲ್‌ಗಳಂತೆ) ತಪ್ಪಿಸಿ. ಚಾಚಿದ ಬೆರಳುಗಳನ್ನು ಹೊಂದಿರುವ ಕೈ ಚೆನ್ನಾಗಿ ಕೆಲಸ ಮಾಡುತ್ತದೆ.",
