    ar: "يتراوح تغيير الخط من كبير وسهل إلى صغير وصعب. لا يمكنك الحصول على أكثر من ثلثي الإجابة الصحيحة، لذا استرخِ. تخيل الأمر كلعبة تخمين، وحاول قدر الإمكان. ستسمع صوت صفير كلما أصبتَ.",
    hy: "Loading...",
    bg: "Loading...",
    "zh-CN": "Loading...",
    "zh-TW":
      "線位移量大小不一，從大到小，從容易到難。你最多只能猜對三分之二，所以放鬆點。把它當成猜謎遊戲，盡量猜對就好。猜對了就會聽到嗶嗶聲。",
    hr: "Pomak linije varira od velikog i lakog do sitnog i teškog. Ne možete dobiti više od dvije trećine točno, pa se opustite. Zamislite to kao igru pogađanja i uzmite što više. Čut ćete zvučni signal kad god ste u pravu.",
    cs: "Posun řádku se liší od velkého a snadného až po malý a tvrdý. Nemůžete dostat víc než dvě třetiny správně, takže se uvolněte. Berte to jako tipovací hru a získejte jich tolik, kolik můžete. Kdykoli budete mít pravdu, uslyšíte pípnutí.",
    da: "Linjeskiftet varierer fra stort og let ned til lille og hårdt. Du kan ikke få meget mere end to tredjedele ret, så slap af. Tænk på det som en gætteleg, og få så mange, som du kan. Du vil høre et bip, når du har ret.",
    nl: "Loading...",
    fi: "Linjan siirto vaihtelee suuresta ja helposta pieneen ja kovaan. Et voi saada enempää kuin kaksi kolmasosaa oikein, joten rentoudu. Ajattele sitä arvauspelinä ja hanki niin monta kuin pystyt. Kuulet piippauksen aina, kun olet oikeassa.",
    fr: "Loading...",
    de: "Die Linienverschiebung variiert von groß und einfach bis winzig und schwierig. Du kannst nicht viel mehr als zwei Drittel richtig erraten, also bleib ruhig. Betrachte es als Ratespiel und errate so viele wie möglich. Du hörst einen Piepton, wenn du richtig liegst.",
    el: "Η μετατόπιση της γραμμής ποικίλλει από μεγάλη και εύκολη σε μικρή και σκληρή. Δεν μπορείτε να πάρετε πολύ περισσότερα από τα δύο τρίτα σωστά, οπότε χαλαρώστε. Σκεφτείτε το ως ένα παιχνίδι εικασιών και απλά πάρτε όσο περισσότερα μπορείτε. Θα ακούσετε ένα μπιπ όποτε έχετε δίκιο.",
    he: "הסטת הקו משתנה בין גדול וקל למטה ועד זעיר וקשה. אתה לא יכול לקבל הרבה יותר משני שליש נכון, אז תירגע. תחשוב על זה כעל משחק ניחושים, ופשוט קבל כמה שאתה יכול. אתה תשמע צפצוף בכל פעם שאתה צודק.",
    hi: "लाइन शिफ्ट बड़ी और आसान से लेकर छोटी और मुश्किल तक होती है। आप दो-तिहाई से ज़्यादा सही नहीं हो सकते, इसलिए आराम करें। इसे एक अनुमान लगाने वाले खेल की तरह समझें, और जितना हो सके उतना सही करें। जब भी आप सही होंगे, आपको एक बीप सुनाई देगी।",
    hu: "A vonaleltolódás a nagy és könnyűtől az apró és keményig terjed. A kétharmadnál többet nem tudsz kihozni, szóval lazíts. Tekintsd úgy, mint egy találgatásra, és szerezz be annyit, amennyit csak tudsz. Hangjelzést fog hallani, amikor igaza van.",
    is: "Línuskiptingin er breytileg frá stórum og auðveldum niður í pínulitla og harða. Þú getur ekki fengið mikið meira en tvo þriðju rétt, svo slakaðu á. Líttu á þetta sem giskaleik og fáðu bara eins marga og þú getur. Þú munt heyra píp þegar þú hefur rétt fyrir þér.",
    id: "Pergeseran garis bervariasi, dari yang besar dan mudah hingga yang kecil dan sulit. Anda hanya bisa menebak dengan benar dua pertiga, jadi santai saja. Anggap saja seperti permainan tebak-tebakan, dan tebaklah sebanyak mungkin. Anda akan mendengar bunyi bip setiap kali tebakan Anda tepat.",
    it: "Lo spostamento di linea varia da grande e facile a piccolo e difficile. Non puoi indovinare più di due terzi, quindi rilassati. Consideralo un gioco di indovinelli e cerca di indovinare il più possibile. Sentirai un segnale acustico ogni volta che indovini.",
    ja: "Loading...",
    kn: "ಲೈನ್ ಶಿಫ್ಟ್ ದೊಡ್ಡದಾಗಿದೆ ಮತ್ತು ಸುಲಭದಿಂದ ಚಿಕ್ಕದಾಗಿದೆ ಮತ್ತು ಗಟ್ಟಿಯಾಗಿರುತ್ತದೆ. ನೀವು ಮೂರನೇ ಎರಡರಷ್ಟು ಹೆಚ್ಚು ಬಲ ಪಡೆಯಲು ಸಾಧ್ಯವಿಲ್ಲ, ಆದ್ದರಿಂದ ವಿಶ್ರಾಂತಿ. ಇದನ್ನು ಊಹಿಸುವ ಆಟ ಎಂದು ಯೋಚಿಸಿ, ಮತ್ತು ನೀವು ಎಷ್ಟು ಸಾಧ್ಯವೋ ಅಷ್ಟು ಪಡೆಯಿರಿ. ನೀವು ಸರಿಯಾಗಿದ್ದಾಗಲೆಲ್ಲಾ ನೀವು ಬೀಪ್ ಅನ್ನು ಕೇಳುತ್ತೀರಿ.",
