    lt: "Linijos poslinkis skiriasi nuo didelio ir lengvo iki mažo ir kieto. Negalite gauti daug daugiau nei du trečdalius, todėl atsipalaiduokite. Pagalvokite apie tai kaip apie atspėjimo žaidimą ir tiesiog gaukite kuo daugiau. Kai būsite teisūs, išgirsite pyptelėjimą.",
    ms: "Anjakan talian berbeza-beza dari besar dan mudah ke kecil dan keras. Anda tidak boleh mendapatkan lebih daripada dua pertiga betul, jadi berehat. Anggap ia sebagai permainan meneka, dan dapatkan seberapa banyak yang anda boleh. Anda akan mendengar bunyi bip apabila anda betul.",
